QueryScripts.ScriptText:
$filematches = select-string "Order Date,Order ID,Title" -path "C:\Users\tomts\Downloads\BILLS\*.csv"
$filematches | select -unique Path | % {
   "Importing: "+$_.Path
   $x = import-csv $_.Path
   $x | % { add-member -inputobject $_ -membertype noteproperty -name JSON -Value (convertto-json $_) }
   $y = $x | select json
   Write-ObjectsToSQLServer -ObjectArray $y -DestinationConnStr $env:MyDbConnStr -InputSproc [usp_AmazonBills_Insert] -BatchSize 100
}

